import React, { useState, useEffect } from "react";
import axios from "axios";

function ReportButton() {
  //const [data, setData] = useState([]);
  const [key, setKey] = useState([]);
  //const [value, setValue] = useState({});

  // BUG bu effect sayfa yenilenince çalışmamalı sadece butona basınca çalışmalı BUG
  const fetchData = useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:3000/report-page");
        setKey(Object.keys(response.data[0]));
        //setValue(Object.values(response.data[0])); // BUG İLK  OBJE GELİYOR SADECE
      } catch (error) {
        console.error("Error fetching data", error);
      }
    };
    fetchData();
  }, []);

  // const handleClick = () => {
  //   console.log(key);
  //   //console.log(value);
  // };

  return (
    <div>
      <button onClick={fetchData}>Veriyi Getir</button>
      <table>
        <tbody>
          <tr>
            {key.map((item, index) => (
              <React.Fragment key={index}>
                <td>{item}</td>
              </React.Fragment>
            ))}
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default ReportButton;

